
create table position (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	title VARCHAR(50),
	pay VARCHAR(50)
);

create table store (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	name VARCHAR(50),
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50)
);

create table employee (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	address VARCHAR(50),
	phone VARCHAR(50),
	position_id INTEGER NOT NULL,
	store_id INTEGER NOT NULL,
	CONSTRAINT FK_employee_position FOREIGN KEY (position_id) REFERENCES posistion(id),
	CONSTRAINT FK_employee_store FOREIGN KEY (store_id) REFERENCES store(id) 
);

create table category (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	name VARCHAR(50)
);

create table brand (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	name VARCHAR(50)
);

create table item (
	Id INTEGER NOT NULL PRIMARY KEY IDENTITY,
	name VARCHAR(50),
	brand_id INTEGER NOT NULL,
	price VARCHAR(50),
	amount_in_stock INTEGER NOT NULL,
	category_id INTEGER NOT NULL,
	store_id INTEGER NOT NULL,
	CONSTRAINT FK_item_brand FOREIGN KEY (brand_id) REFERENCES brand(id),
	CONSTRAINT FK_item_category FOREIGN KEY (category_id) REFERENCES category(id),
	CONSTRAINT FK_item_store FOREIGN KEY (store_id) REFERENCES store(id)
);

create table payment_type (
	name VARCHAR(50)
);








